import folium
import polyline
import numpy as np

#testPolyline = polyline.decode('qetiGp`tcNuCwSfYsHgHem@x}A_f@bC}WhFmCyG{j@`B_`@aP{Xoe@acEc_@ekC')


def merge(list1, list2): 
      
    merged_list = [(list1[i], list2[i]) for i in range(0, len(list1))] 
    return merged_list 

def get_route(latList, lonList, m):
    
    #loc = "{},{};{},{}".format(pickup_lon, pickup_lat, dropoff_lon, dropoff_lat)
    
    for i in range(len(latList)-1):
        lat = latList[i]
        lon = lonList[i]
        
        pickup_lon = lon[0]
        pickup_lat = lat[0]
        dropoff_lon = lon[len(lon) - 1]
        dropoff_lat = lat[len(lat) - 1]
        
        routes = merge(lat, lon)
        
        start_point = [pickup_lat, pickup_lon]
        end_point = [dropoff_lat, dropoff_lon]
        
        out = {'route':routes,
               'start_point':start_point,
               'end_point':end_point
              }
    
        m = get_map(out, m)
    
    m.save("mymapAllTrips.html")
    
    return m


def get_map(route, m):

    folium.PolyLine(
        route['route'],
        weight=8,
        color='blue',
        opacity=0.6
    ).add_to(m)

    folium.Marker(
        location=route['start_point'],
        icon=folium.Icon(icon='play', color='green')
    ).add_to(m)

    folium.Marker(
        location=route['end_point'],
        icon=folium.Icon(icon='stop', color='red')
    ).add_to(m)

    return m

